import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import PlayerPicksPage from './components/PlayerPicksPage';
import ViewScoresPage from './components/ViewScoresPage';
import AdminUploadPage from './components/AdminUploadPage';
import AdminWinnersPage from './components/AdminWinnersPage';

function App() {
  const navStyle = {
    display: 'flex',
    gap: '20px',
    padding: '20px',
    borderBottom: '1px solid #ccc'
  };

  const linkStyle = {
    textDecoration: 'none',
    color: 'blue',
    fontWeight: 'bold'
  };

  return (
    <Router>
      <div style={{ fontFamily: 'Arial, sans-serif' }}>
        <nav style={navStyle}>
          <Link to="/" style={linkStyle}>Make Picks</Link>
          <Link to="/scores" style={linkStyle}>View Scores</Link>
          <Link to="/admin" style={linkStyle}>Admin Upload</Link>
          <Link to="/admin-winners" style={linkStyle}>Admin Winners</Link>
        </nav>

        <div style={{ padding: '20px' }}>
          <Routes>
            <Route path="/" element={<PlayerPicksPage />} />
            <Route path="/scores" element={<ViewScoresPage />} />
            <Route path="/admin" element={<AdminUploadPage />} />
            <Route path="/admin-winners" element={<AdminWinnersPage />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
